const Input = ({ name, type, value, placeholder }) => {
  return (
    <div className='relative w-[100%] mb-4'>
      <input 
        name={name}
        type={type}
        value={value}
        placeholder={placeholder ?? placeholder}
      />
    </div>
  )
}

